import { useState } from 'react';
import Head from 'next/head'
import styled from 'styled-components';
import { Button } from '@zeit-ui/react'
import { AiOutlineShopping } from "react-icons/ai";


export const HeaderWrapper = styled.div`
  padding:0% 4% 0% 4%;
  width:100vw;
  height:10vh;
  background:#f1f1f1;
  display:grid;
  grid-template-columns:15% 50% 35%;
  align-items:center;
`;
export const LogoWrapper = styled.h4`
margin:0;
color:white;
font-family:'Roboto',sans-serif;
`;
export const MenuWrapper = styled.div`
  display:grid;
  grid-template-columns: auto auto auto auto auto auto;
`;
export const ATag = styled.a`
color:#333;
font-size:0.9rem;
font-family:'Roboto',sans-serif;
`;
 
const Header = () => {
 
    return (
        <HeaderWrapper>
            <LogoWrapper> Turismo La Rioja</LogoWrapper>
            <MenuWrapper> 
                <ATag href="#!"> Que hacer </ATag>
                <ATag href="#!">Reservá</ATag>
                <ATag href="#!">Descubrila </ATag>
                <ATag href="#!">Información </ATag>
                <ATag href="#!">Contacto </ATag>
                <ATag href="#!">Profesionales </ATag>
            </MenuWrapper>
            <h6> Español</h6>
        </HeaderWrapper>
      );
}
 
export default Header;
